Who hates queuing for steamboat as much as I do? 

@hotpot_master_delivery delivers high-quality hotpot you have in restaurants right infront of your doorstep so you can enjoy it conveniently at home! I had the privilege to try the super value hotpot set starting from $68 and it was amazing. 

It comes with two soup base, Suan La Fen and Super Collagen, so you can have best of both world from the numbingly spicy mala soup to savory chicken collagen soup. 

The steamboat ingredients included assorted vegetables such as mushrooms, cabbage, corn and meat selections included crab stick, chicken and pork. I loved how this value set also included the hotpot mastersâ€™ specialty dishes: drunken chicken, tobiko prawn paste and grilled salmon roll. Adding the drunken chicken to the collagen soup resembled eating ginseng chicken soup and the grilled salmon roll was extremely tender and went very well with the mala soup base.

@hotpot_master_delivery also provides the yuanyang pot and induction stove as well so you really donâ€™t have to worry about any set-ups. The whole set includes not only the condiments and various sauces but also the disposable paper plates and cutleries!

